import boat from '../../../assets/boat.png'

export const SlideOne = () => {
    return (
        <STutorialBackground>
            <img src={boat} alt='boat' width={40} height={40} />
            <p>You are a pirate and this is your lovely warship.</p>
        </STutorialBackground>
    )
}
